import Vue from 'vue'
import App from '@/App.vue'
import router from '@/router'
// import store from './store'

// Create the app instance
const app = Vue({
  // router,
  render: (h) => h(App)
}
)

// Add tue router instance
// app.use(router)

// Then mount the app instance
app.mount('#app')
